import "./index.css";

const personajes = ["Rimuru", "Ciel", "Kaguya", "Shirogane"];

const [, , p3] = personajes;

console.log(p3);

const retornarArreglo = () => {
  return ["ABC", 123];
};

const [letras, numeros] = retornarArreglo();

console.log(letras, numeros);

// Tarea

const useState = (valor) => {
  return [
    valor,
    () => {
      console.log("Hola Mundo");
    },
  ];
};
